  false,\n\t\"url\": null,\n\t\"notes\": \"Real-time kinematic global navigation satellite
  systems equipment was used to map features of wetlands at six locations of interest
  to the Lower Brule Sioux Tribe. Items mapped include general cross-sections (primarily
  to show elevation differences); man-made features such as access roads, outlet control
  structures, and water-supply pipes; vegetation features such as edge of cattails
  or food plots, trees or tree clusters; and hydrologic features like edge of water,
  springs, and high water marks.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
